import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import {
  BrowserRouter as Router,Routes,
  Route
} from 'react-router-dom';

ReactDOM.render(
  <Router basename='/mirrorsReactThreeFiber'>
<Routes>
    <Route path='/' element={<App/>} />
    </Routes>
  </Router>,
  document.getElementById('root')
);
